import React from "react";
//import {Table} from "reactstrap";

const Page = (props) => {
  return (
    <div>
      <div>
         <span className="status">
          status
          <i
            className={props.status ? "fas fa-arrow-down" : "fas fa-arrow-up"}
          ></i>
        </span>
        <button
          onClick={props.handleAscending}
          className={props.status ? "Ascending" : "Descending"}
          type="button"
        >
          {props.status ? `Click for Ascending` : `Click for Descending`}{" "}
        </button> 
        <h1>High Scores Per Country </h1>
      </div>
      {props.data.CountryScores.sort((a, b) => (a.name > b.name ? 1 : -1)).map(
        (eachCountry, index) => (
          <table className="table" bordered key={index}>
            <tbody>
              <tr>
                <td>
                  <h1>
                    <span className="table-header">High Scores: </span>
                    <span className="countryName">{eachCountry.name}</span>
                  </h1>
                </td>
              </tr>
              <tr>
                <td className="table">
                  {props.status
                    ? eachCountry.scores
                        .sort((a, b) => (a.s > b.s ? -1 : 1))
                        .map((element, i) => (
                          <table bordered className="table" key={i}>
                            <tbody>
                              <td>
                                {element.n.toUpperCase() + ":aaa " + element.s}
                              </td>
                            </tbody>
                          </table>
                        ))
                    : eachCountry.scores
                        .sort((a, b) => (a.s < b.s ? -1 : 1))
                        .map((element, i) => (
                          <table bordered className="table" key={i}>
                            <tbody>
                              <tr>
                                {element.n.toUpperCase() + ": " + element.s}
                              </tr>
                            </tbody>
                          </table>
                        ))}
                </td>
              </tr>
            </tbody>
          </table>
        )
      )}
    </div>
  );
};

export default Page;
